import React, { useState } from 'react';
import Fade from 'react-reveal/Fade';
import './FFNav.css';

export default function FFNav() {
  const [date, setDate] = useState(new Date());

  const getTime = () => {
    setTimeout(()=> setDate(new Date()), 1000);
    let times = date.getHours() + ":" + date.getMinutes() + ":" + date.getSeconds();
    return times;
  }

  return (
    <Fade right duration={200}>
      <aside>
        <nav className="side-menu">
          <p>Menu</p>
          <ul>
            <li>Sobre Mim</li>
          </ul>
          <p>Projetos</p>
          <ul>

          </ul>
        </nav>
        <div className="timer-container">
          <p>Time {getTime()}</p>
        </div>
      </aside>
    </Fade>
  )
}
